duty:
一、被告孙月珍于本判决生效之日起十日内归还原告刘志庆借款40,000元；
　　二、被告孙月珍于本判决生效之日起十日内支付原告刘志庆借款利息（计算方式：以借款本金40,000元为基数，自2015 年12月30日起至2016年3月31日止，按月利率1.8%计算，扣除已支付利息300元）;
　　三、被告孙月珍于本判决生效之日起十日内支付原告刘志庆逾期还款违约金（计算方式：以借款本金40,000元为基数，自2016 年4月1日起至实际清偿之日止，按月利率1.8%计算）;
　　四、被告孙月珍于本判决生效之日起十日内支付原告刘志庆律师费4,000元。
　　案件受理费1,779元，由被告孙月珍负担（于本判决生效之日起七日内交付本院）。
